%pyspark
import numpy as np
from datetime import datetime, timedelta

def deg2rad(angle):
    return (angle * np.pi) / 180

def rad2deg(rad):
    return (180 * rad) / np.pi

def get_declination(obj_dt):
    day_of_year = obj_dt.timetuple().tm_yday
    fr_time_day = (obj_dt.hour + obj_dt.minute/60) / 24
    return -23.44 * np.cos(2*np.pi*(day_of_year + fr_time_day + 10)/365)

def get_culmination_time(dt):
    obj_cul = datetime.datetime(hour=12, minute=30)
    return obj_cul

def get_hour_angle(obj_dt):
    # 1시간에 15도
    # 12시간에 15*12
    # 남중(12시간 30분)에 15*12.5 = 187.5
    # 남중(12시간 31분)에 15*12.5 + 0.25 = 187.75

    # obj_cul = get_culmination_time(obj_dt)
    # return ((obj_dt.hour + obj_dt.minute / 60) - (obj_cul.hour + obj_cul.minute / 60)) * 15

    return ((obj_dt.hour + obj_dt.minute / 60) * 15) - 187.75

def get_elevation(decl, lat, hagl):
    return np.arcsin(np.sin(decl)*np.sin(lat) + np.cos(decl)*np.cos(lat)*np.cos(hagl))
